import logotype from './logo.svg';
import './App.css';
//import AppHeader from './AppHeader';

const AppHeader = (props) => <div>Hey you! {props.firstName} {props.lastName}!</div>;

function App() {
  return (
    <div className="App">
      <AppHeader firstName="John" lastName="Smith" />
    </div>
  );
}

export default App;
